import styles from './Friends.module.css'

import defaultImg from '../../image/defaultImg.jpg'


const Avatar = ({ url }) => (
    <img className={styles.avatar} src={!!url ? url : defaultImg} alt="pic" width="70px" />
);

Avatar.defaultProps = {
    url: defaultImg,
};


export default Avatar;
